import React from 'react';
import { View, ScrollView, Text, Dimensions, TextInput, TouchableOpacity, StyleSheet } from 'react-native';
import { FontAwesome } from '@expo/vector-icons';
import { MaterialCommunityIcons } from '@expo/vector-icons';

function Profile(props) {
    const window = Dimensions.get('window')

    return (
        <ScrollView style={{
            height: '100%',
            width: '100%',
            backgroundColor: 'red',
            flexDirection: 'column',
            overflow: 'visible',


        }}>
            <View style={{
                width: window.width / 5,
                height: window.width / 5,
                borderRadius: window.width / 10,
                backgroundColor: 'white',
                position: 'absolute',
                top: 120,
                left: window.width / 2,
                right: window.width / 2,
                zIndex: 60,
                bottom: 6,

                alignItems: 'center',
                shadowOffset: {
                    height: 1,
                    width: 1,
                },
                shadowColor: 'black',
                shadowOpacity: 1,
                elevation: .5,
                shadowRadius: '50%',
                overflow: 'visible',
                backgroundColor: 'black',

            }}>

            </View>

            <View style={{
                height: 400,
                backgroundColor: 'white',

                margin: 20,
                borderRadius: 20,
                marginTop: 170,
                alignItems: 'center',



            }}>
                <Text style={{
                    marginTop: 60,
                    textAlign: 'center',

                    fontWeight: 'bold',

                }}>
                    Eng.Md.Sazzad Hossain
                </Text>
                <Text style={{
                    textAlign: 'center',
                }}>
                    sazzad15-2521@diu.edu.bd
                </Text>
                <View style={{
                    height: 2,
                    backgroundColor: 'red',
                    marginTop: 10,
                }}>

                </View>
                <View style={{
                    height: 30,
                    flexDirection: 'row',
                }}>
                    <View style={
                        styles.row

                    }>
                        <FontAwesome style={{
                            marginLeft: 8,
                        }} name="user" size={24} color="black" />

                    </View>
                    <TextInput style={
                        styles.input
                    }>
                    </TextInput>

                </View>
                <View style={{
                    height: 30,
                    flexDirection: 'row',
                    marginTop:10,
                }}>
                    <View style={
                        styles.row

                    }>
                        <FontAwesome style={{
                            marginLeft: 8,
                        }} name="phone" size={24} color="black" />

                    </View>
                    <TextInput style={
                        styles.input
                    }>
                    </TextInput>

                </View>
                <View style={{
                    height: 30,
                    flexDirection: 'row',
                    marginTop:10,
                }}>
                    <View style={
                        styles.row

                    }>
                        <MaterialCommunityIcons style={{
                            marginLeft: 8,
                        }} name="email-outline" size={24} color="black" />

                    </View>
                    <TextInput style={
                        styles.input
                    }>
                    </TextInput>

                </View>

            </View>


        </ScrollView>
    );
}

export default Profile;
const styles = StyleSheet.create({
    row: {
        height: 34,
        width: 34,
        flexDirection: 'row',
        borderColor: '#808080',
        borderRadius: 17,
        borderWidth: 1,
        alignItems: 'center',
        marginLeft: 10,
    },
    input:{
        height:34,
        marginRight:10,
        flex: 7,
        marginLeft: 10,
        borderColor:'#808080',
        borderWidth:1,
        borderRadius:17,
    }
})
